import { LessonComponent } from "../Components/Lessons.jsx";
import { scienceLessons, scienceQuizzes } from "../data";
import braixen from "../images/dd6f9oj-99e6d1f7-7929-4202-bb07-5555667e9e8c.gif";
import { Button } from "reactstrap";
export const Home = () => {
  return (
    <main className="App">
      <img width="500px" src={braixen} alt="braixen" />

      <section className="lessons">
        <section>
          <h1>Science Lessons</h1>
          <ul>
            {scienceLessons.map((lesson, index) => (
              <li key={index}>
                <Button>{lesson.title}</Button>
              </li>
            ))}
          </ul>
        </section>
        <section>
          <h1>Social Studies Lessons</h1>
          <ul></ul>
        </section>
        <section>
          <h1>Language Arts Lessons</h1>
          <ul></ul>
        </section>
        <section>
          <h1>Math Lessons</h1>
          <ul></ul>
        </section>
      </section>
    </main>
  );
};
